public class Solution {
	
	public boolean MatchWithQMark(String s, String p, int start) {
		if (start + p.length() > s.length()) return false;
		for (int i = start, j = 0;j < p.length(); ++j, ++i) {
			if (p.charAt(j) == s.charAt(i) || p.charAt(j) == '?') continue;
			return false;
		}
		return true;
	}
	
	public int sum(String[] tp) {
		int sum = 0;
		for (int i = 0; i < tp.length; ++i) sum += tp[i].length();
		return sum;
	}
	
	public boolean isMatch(String s, String p) {
		String[] tp = p.split("\\*+", -1);
		if (tp.length < 2) return MatchWithQMark(s, p, 0) && (s.length() == p.length());
		String tail = tp[tp.length-1];
		int start = 0, end = s.length(), length=sum(tp), index = 1, size = tp.length-1; // include start, exclude end
		if (tail.length() > 0) {
			if ((end-tail.length() >= 0) && MatchWithQMark(s, tail, end - tail.length())) {
				end = s.length() - tail.length();
				length -= tail.length();
			}
			else return false;
		}
		if (tp[0].length() > 0) {
			if (MatchWithQMark(s, tp[0], start)) {
				start += tp[0].length();
				length -= tp[0].length();
			} else return false;
		}
		for (int i = start; i < end && index < size;) {
			if (length > end - i) return false;
			if (MatchWithQMark(s, tp[index], i)) {
				length -= tp[index].length();
				i += tp[index].length();
				++index;
			}
			else ++i;
		}
		return (start <= end) && (index == size);
    }
	
	public boolean isMatch2(String s, String p) {
		boolean[][] dp = new boolean[s.length()+1][p.length()+1];
        dp[0][0] = true;
        int i, j;
        for (i = 0; i < s.length(); ++i) dp[i+1][0] = false;
        for (i = 0; i < p.length(); ++i) dp[0][i+1] = dp[0][i] && p.charAt(i) == '*';
        for (i = 0; i < s.length(); ++i) {
            for (j = 0; j < p.length(); ++j) {
                dp[i+1][j+1] = (p.charAt(j) == '*' ? (dp[i+1][j] || dp[i][j+1]) : false) || ((p.charAt(j) == s.charAt(i) || p.charAt(j) == '?') ? dp[i][j] : false);
            }
        }
        return dp[s.length()][p.length()];
	}
	
	public static void main(String[] args) {
		Solution s = new Solution();
		System.out.println(s.isMatch2(
				"", 
				"**"));
	}
}